// Contact.js
import React from 'react';
import './Contact.css';

const Contact = () => (
  <section id="contact" className="contact-section">
    <h2>Contact</h2>
    <p>
      Feel free to reach us at <a href="mailto:contact@imagesearch.com">contact@imagesearch.com</a>
    </p>
  </section>
);

export default Contact;
